const Gif = () => {
  return <img src="path/to/your/gif.gif" alt="Описание GIF" />;
};

const HomePage = () => {
  return (
    <InfoWrapper>
      <InfoImg src={camper} alt="camper" />
      <InfoTitle>Hello!</InfoTitle>
      <p>Captivating adventures await you with our camper rental!</p>
    </InfoWrapper>
  );
};

export default HomePage;
